Resultados acumulados a la cuarta semana de Abril de 2021
El indice de marzo de 2021 esta compuesto por los precios de la última semana del mes ya que en ese momento fue cuando inicie la recolección de datos, debido a esto las variaciones del corriente mes pueden estar subestimadas.




